window.bookSummaryJSON = "<p><b>A brand-new full-cast audiobook production of the classic collaboration from internationally best-selling authors Neil Gaiman and Terry Pratchett starring Rebecca Front as the Narrator, Michael Sheen as Aziraphale, and David Tennant as Crowley!</b></p> <p><b>\"</b><b><i>Good Omens</i></b><b>...is something like what would have happened if Thomas Pynchon, Tom Robbins and Don DeLillo had collaborated. Lots of literary inventiveness in the plotting and chunks of very good writing and characterization. It’s a wow. It would make one hell of a movie. Or a heavenly one. Take your pick.\" (</b><b><i>Washington Post</i></b><b>)</b></p> <p>According to&nbsp;<i>The Nice and Accurate Prophecies of Agnes Nutter</i>,&nbsp;<i>Witch</i>&nbsp;(the world's only&nbsp;<i>completely</i>&nbsp;accurate book of prophecies, written in 1655, before she exploded), the world will end on a Saturday. Next Saturday, in fact. Just before dinner.</p> <p>So the armies of Good and Evil are amassing, Atlantis is rising, frogs are falling, tempers are flaring. Everything appears to be going according to Divine Plan. Except a somewhat fussy angel and a fast-living demon - both of whom have lived amongst Earth's mortals since The Beginning and have grown rather fond of the lifestyle - are not actually looking forward to the coming Rapture.</p> <p>And someone seems to have misplaced the Antichrist....</p> <p><b>Don’t miss Season 2 of the Prime original series!</b></p> <p><b>Dramatis personae:</b></p> <p><b>Supernatural Beings</b></p> <p><b>Rebecca Front: Narrator</b></p> <p><b>Michael Sheen: Aziraphale</b></p> <p><b>David Tennant: Crowley</b></p> <p><b>Humans</b></p> <p><b>Katherine Kingsley: Anathema Device</b></p> <p><b>Arthur Darvill: Newton Pulsifer</b></p> <p><b>Peter Forbes: Shadwell</b></p> <p><b>Gabrielle Glaister: Madame Tracy and Agnes Nutter</b></p> <p><b>Them</b></p> <p><b>Louis Davison: Adam</b></p> <p><b>Pixie Davies: Pepper</b></p> <p><b>Chris Nelson: Wensleydale</b></p> <p><b>Ferdinand Frisby Williams: Brian</b></p> <p><b>Ensemble</b></p> <p><b>Adjoa Andoh, Allan Corduner, Kobna Holdbrook-Smith, Josh Hopkins, Lorelei King, Matt Reeves, and Lemn Sissay</b></p>"; 
